$templateCache.put('/app/operations/operation.html','<h3 class="primary-title">Operaciones</h3><div class="content-panel tranfers"><ul class="act-nav-tabs"><li ui-sref-active="active"><a ui-sref="account">Cuenta</a></li><li ng-class="{disabled: !operations.sclient.data, active: $state.includes(\'portfolio.detail\')}"><a ng-click="operations.getSelectedClient(\'portfolio.detail\')">Portafolio</a></li><li><a style="color: white;">_</a></li><li><a style="color: white;">_</a></li></ul><div class="row margin-0"><div ui-view=""></div></div></div><!-- Page instructions--><div class="page-instructions" ng-show="operations.show_instructions"><div class="panel panel-default"><div class="panel-heading" ng-hide="operations.sclient.data">Instrucciones de operaci\xF3n</div><div class="panel-body"><!-- Steps--><div class="steps" ng-hide="operations.sclient.data"><p>Debes confirmar con tu cliente en todas las operaciones solicitadas:</p><div class="row"><div class="col-xs-6"><p>1. N\xFAmero de contrato</p><p>2. Nombre completo de tu cliente</p><p>3. Operaci\xF3n solicitada</p></div><div class="col-xs-6"><p>4. # de T\xEDtulos y/o Monto de la operaci\xF3n y/o "Valor Mercado"</p><p>5. Emisora: Nombre y/o Clave de la Emisora</p><p>6. Fecha: Si se solicita la operaci\xF3n en una fecha posterior</p></div></div><p>Tu bit\xE1cora de operaci\xF3n deber\xE1 incluir:<strong> Extensi\xF3n, fecha y hora.</strong></p></div><!-- Process--><div class="process"><h2>Llamadas con clientes</h2><div class="row"><div class="col-xs-6"><div class="details"><h3>\xBFQu\xE9 debemos hacer?</h3><ul><li>Consulta el perfil del cliente</li><li>Considera lo siguiente para emitir sugerencias:<ul><li>Plazo</li><li>Periodo de liquidaci\xF3n</li><li>Riesgo</li><li>Volatilidad</li></ul></li></ul></div></div><div class="col-xs-6"><div class="details"><h3 class="forbidden">Est\xE1 prohibido</h3><ul><li>Utilizar el celular o whatsapp</li><li>Garantizar rendimientos</li><li>Utilizar frases como:<ul><li>Te recomiendo...</li><li>Yo creo que...</li><li>Yo esperar\xEDa que...</li></ul></li><li>Ingresar datos incorrectos en la bit\xE1cora de operaciones, ya que podr\xEDas ser sancionado.</li></ul></div></div></div><p><strong>Recuerda:</strong> Los contratos<strong> discrecionales,</strong> requieren de una instrucci\xF3n de operaci\xF3n de manera obligatoria en cualquier emisi\xF3n de Grupo Financiero Actinver.</p></div></div></div></div>');
